description:
A polygon dataset showing critical industry Equine Clusters in the Upper Hunter region. The horse breeding cluster includes a highly integrated concentration of horse breeding facilities and related infrastructure covering thoroughbred and stock horse breeding centres and numerous other equine developments and support services, such as a specialised veterinary centre.
Industry clusters that meet the following criteria:
 - there is a concentration of enterprises that provides clear development and marketing advantages and is based on an agricultural product;
 - the productive industries are interrelated;
 - it consists of a unique combination of factors such as location, infrastructure, heritage and natural resources;
 - it is of national and/or international importance;
 - it is an iconic industry that contributes to the region's identity; and
 - it is potentially substantially impacted by coal seam gas or mining proposals.
The equine cluster is spatially defined as land (excluding National Park and State Forest) having a slope of equal to or less than 18 degrees and falling within the following buffers:
 - In the Upper Hunter LGA - within 15 km of the New England Highway; 
 - In the Muswellbrook LGA - within 2 km of the Muswellbrook Denman Road or the New England Highway north of Muswellbrook; 
 - In the Muswellbrook and Upper Hunter LGAs - within 2km to the north and 10km to the south of the Golden Highway between Sandy Hollow and the Muswellbrook/Singleton LGA boundary; 
 - In the Mid Western Regional, Muswellbrook and Upper Hunter LGAs - within 5km of the Bylong Valley Way or Martindale Road or the Baerami Creek Road or Widden Valley Road; 
 - In the Singleton LGA - within 2km to the north and 10km to the south of the Golden Highway between Jerrys Plains and the Muswellbrook/ Singleton LGA boundary.

This dataset identifies the project boundaries for registered Australian Carbon Credit Unit (ACCU) Scheme area based projects. Area based projects are generally savanna burning and sequestration activities.

These ACCU Scheme projects are registered across a declared project area identified by project proponents at the time of registration. These project areas generally encompass the entire cadastral boundaries for the properties for which the participants intend to conduct their project activities and for which they hold legal right.

For sequestration projects the project area does not generally represent the actual extent of a project activity which is generally a subset of the project area. These subset areas are known as Carbon Estimation Areas (CEA) which are defined by rules set out in the individual ACCU Scheme methods. A project can contain one or many CEAs.

The dataset includes basic attribution including:
Scheme Participant;
Project Name;
Project ID;
Method;
Method Type;
Project Description;
Date Project Registered;
Project location (State);
Project location (Postcode);
Permanence Period; 
Project Status (Active or Revoked); and,
Area Ha

The Clean Energy Regulator publishes and maintains a project register which contains further details about projects registered under the Emissions Reduction Fund. The project register is published on the Clean Energy Regulator website at https://cer.gov.au/markets/reports-and-data/accu-project-and-contract-register?view=Projects and is the point of truth for information about ACCU Scheme projects.

The project register contains attributes not in the spatial dataset, such as, the number of Australian carbon credit units (ACCUs) issued, whether any units have been relinquished, or if that land has a carbon maintenance obligation in place. However, the Project Id attribute (PROJ_ID) can be used to link the mapping data with the project register if analysis of those attributes is required.

Notes:

1. Users should be aware that the project register is updated on a monthly basis.

2. The dataset does not contain the boundaries of ten projects which have had their location suppressed or partially suppressed.

3. The dataset contains revoked projects. These are identified as being revoked in the status column
